import React from 'react';
import './App.css';
import {connect} from "react-redux";
import { actionSetName } from './ducks/playersReducer'
import { actionPlace } from './ducks/boardReducer'
import Game from "./components/Game";
import InputNames from "./components/inputNames";
import Board from "./components/Board";

const App = props => {
 return (
     <div className="App">
         <InputNames
             name1={props.name1}
             name2={props.name2}
             actionSetName={props.actionSetName}
         />
         <Board />
     </div>
 )
};

const mapStateToProps = (state) => ({
    name1: state.players[0],
    name2: state.players[1]
});

export default connect(mapStateToProps, { actionSetName, actionPlace })(App);
